import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Demo from "./pages/demo/Demo.jsx";
import "./App.css";

function App() {
    return (
        <Router>
            <Switch>
                <Route exact path="/" component={Demo} />
                <Route exact path="/demo:id" component={Demo} />
            </Switch>
        </Router>
    );
}

export default App;
